SELECT substring(w_warehouse_name,1,20), sm_type, cc_name, sum(case when (cs_ship_date_sk - cs_sold_date_sk <= 30) then 1 else 0 end) as "30 days", sum(case when (cs_ship_date_sk - cs_sold_date_sk > 30 and cs_ship_date_sk - cs_sold_date_sk <= 60) then 1 else 0 end) as "31-60 days", sum(case when (cs_ship_date_sk - cs_sold_date_sk > 60 and cs_ship_date_sk - cs_sold_date_sk <= 90) then 1 else 0 end) as "61-90 days", sum(case when (cs_ship_date_sk - cs_sold_date_sk > 90 and cs_ship_date_sk - cs_sold_date_sk <= 120) then 1 else 0 end) as "91-120 days", sum(case when (cs_ship_date_sk - cs_sold_date_sk > 120) then 1 else 0 end) as ">120 days" FROM catalog_sales INNER JOIN date_dim ON cs_ship_date_sk = d_date_sk INNER JOIN warehouse ON cs_warehouse_sk = w_warehouse_sk INNER JOIN ship_mode ON cs_ship_mode_sk = sm_ship_mode_sk INNER JOIN call_center ON cs_call_center_sk = cc_call_center_sk WHERE d_month_seq BETWEEN 1192 AND 1192 + 23 AND cs_list_price BETWEEN 86 AND 115 AND sm_type = 'EXPRESS' AND cc_class = 'small' AND w_gmt_offset = -5 GROUP BY substring(w_warehouse_name,1,20), sm_type, cc_name ORDER BY substring(w_warehouse_name,1,20), sm_type, cc_name LIMIT 100